export class Staff {
    numeroIdentidad: number;
    nombre: string;
    apellidos: string;
    img: string;
    celular: string;
    direccion: string;
    grupoSanguineo: string;
    nombreAcudiente: string;
    contactoAcudiente: string;
    area: string;
    fechaNacimiento: string;
    created_at: Date;
  
    constructor(staffData: any) {
      this.numeroIdentidad = staffData.numeroIdentidad;
      this.nombre = staffData.nombre;
      this.apellidos = staffData.apellidos;
      this.img = staffData.img;
      this.celular = staffData.celular;
      this.direccion = staffData.direccion;
      this.grupoSanguineo = staffData.grupoSanguineo;
      this.nombreAcudiente = staffData.nombreAcudiente;
      this.contactoAcudiente = staffData.contactoAcudiente;
      this.area = staffData.area;
      this.fechaNacimiento = staffData.fechaNacimiento;
      this.created_at = staffData.created_at;
    }
  }
